import {BrowserRouter , Route , Switch } from "react-router-dom";
import {LandingPage} from "../"

function App() {
  return (
    <BrowserRouter>
      <div className="app"> 
      <Switch>
        <Route exact path="/" component= {LandingPage} ></Route>
      
      </Switch>
      </div>
    
    </BrowserRouter>
  )
}

export default App;
